We use { SENT-FORM } to notate a part of a production rule which can be repeated as many times as we want. We can also combine this with the alternative notation to as {SENT-FORM-1 | SENT-FORM-2 | ... | SENT-FORM-k} to represent a collection of choices we may repeat as many times as we want. In the same grammar as above, we can rewrite the recursive production rules in terms of repetition. <expr> ::= <only-mul-div> { (+ | -) <only-mul-div> }
<only-mul-div> ::= <var-or-parens> { (* | /) <var-or-parens> }
<var-or-parens> ::= x | ( <expr> ) In general, we can think of the following pairs of rules as equivalent. <a> ::= a { b }
<a> ::= a | <a> b <a> ::= { b } a
<a> ::= a | b <a> Exercise. Write an EBNF specification for Boolean expressions in Python.
